INSERT INTO `artikel` (`id`, `judul`, `judul_kedua`, `author`, `deskripsi`, `kategori`, `gambar`) VALUES
(2, 'Soto Madura', 'Asal usulnya', 'wira lagi', 'Soto Madura (Madura: Soto Mâdhurâ) adalah jenis soto yang berasal dari daerah Madura, Jawa Timur berbahan dasar daging sapi, telur rebus, kentang goreng dan tauge, dengan bumbu ketumbar, bawang merah dan bawang putih, jahe, kunir, laos, kemiri, jeruk purut, dan garam secukupnya.[1] Karena ada ekslusivitas di setiap wilayah, istilah soto Madura tidak digunakan di wilayah Arekan dan Tapal Kuda Jawa Timur bagian barat melainkan sebagai soto daging.\nVariasi dari setiap wilayah :\n- Soto Sumenep: Soto ini disajikan dan dimakan dengan singkong, tauge goreng, bihun, bawang daun, bawang goreng, lontong, daging sapi atau usus sapi. Yang membedakan dengan Soto Pamekasan & Soto Bangkalan adalah bumbu kacangnya yang terdiri dari kacang, petis dan pisang muda yang diulek halus.\n- Soto Pamekasan: terdiri dari kentang rebus, perkedel kentang, tauge, daging sapi atau daging ayam, soun, lontong, dan disiram dengan kaldu bening dengan bumbu merica dan bawang putih. Disajikan dengan bawang goreng, daun seledri, rempeyek dan bakwan jagung.\n- Soto Bangkalan: memakai tauge dan soun dengan daging sapi, ayam atau jeroan. Disajikan dengan ditaburi kentang goreng dan kuah kuning berbumbu kunyit dan jahe.\n\n\n\n\n\n', 'Kuliner', );
INSERT INTO `artikel` (`id`, `judul`, `judul_kedua`, `author`, `deskripsi`, `kategori`, `gambar`) VALUES
(3, 'Motif Batik Tulis Madura', 'Filosofi dan Jenisnya', 'Wira Selfina Laydi', 'Dari segi motif, batik tulis Madura dibedakan menjadi dua yaitu motif batik pesisiran dan batik pedalaman. Batik pesisiran mempunyai karakteristik motif dan warna yang lebih terang. Sedangkan batik pedalaman lebih bergaya klasik dengan ornament utama menggunakan warna gelap.\n Ciri khas lain dari batik Madura adalah titik putih yang merupakan pengaruh dari tipografi pulau Madura yang didominasi oleh pantai. Selain itu, pulau Madura sebagai penghasil garam menjadikan titik putih sebagai representasi. \n\n\nMotif lain yang digunakan dalam batik Madura adalah tumbuhan dan binatang yang dikombinasikan sesuai dengan kreativitas pembatik. Selain itu, batik Madura juga menggunakan garis yang dominan dalam satu desain batik. \n\n\n\n\n', 'Sejarah', );
INSERT INTO `artikel` (`id`, `judul`, `judul_kedua`, `author`, `deskripsi`, `kategori`, `gambar`) VALUES
(5, 'Keunikan Keraton Sumenep', 'Sejarah & Filosofinya', 'google', 'Selain Asta Tinggi dan Masjid Agung yang menjadi jejak kebesaran Kerajaan Sumenep, ada juga peninggalan masa lalu yang sampai saat ini tetap terawat, yakni keraton. Sebagaimana dalam filosofinya, keraton menggambarkan bagaimana manusia dilahirkan ke muka bumi sebagai khalifah. Semua manusia akan menjadi pemimpin ataupun ada yang dipimpin adalah fitrah yang nantinya akan dimintai pertanggung jawaban oleh Allah swt.\nKeraton merupakan kediaman resmi para Adipati sekaligus pusat pemerintahan di masa lalu. Dalam catatan sejarah, keraton Sumenep banyak jumlahnya, karena setiap pergantian raja, keraton berpindah-pindah atau tidak menetap. Daerah-daerah yang sempat dijadikan keraton oleh Raja Sumenep adalah Batu Putih, Banasare, Aeng Nyeor, Bluto, Keles, Bukabu, Baragung, Blingi Sepudi, Nyamplong Sepudi, Gapura, Parsanga, Karang Sabu, Karang Toroi, dan terakhir di Pajagalan yang lokasinya di sebelah timur alun-alun Kota Sumenep.\n\nJika para pelancong berkunjung ke Sumenep, keraton yang masih utuh adalah keraton yang bangun oleh Raden Ayu Rasmana Tirtonegoro dan Raden Tumenggung Tirtonegoro Muhammad Saud (Bindarah Mohammad Saud, Raja ke-30). Di masa kepemimpinan Panembahan Notokusumo Asiruddin atau Penembahan Sumolo (Raja ke-31), ia membangun pintu gerbang, pendopo ageng, keraton dalem dan taman sare. Arsitekturnya adalah seorang warga keturunan Tionghoa bernama Law Piango.\n', 'Sejarah', );
INSERT INTO `artikel` (`id`, `judul`, `judul_kedua`, `author`, `deskripsi`, `kategori`, `gambar`) VALUES
(6, 'Keindahan Tersembunyi', 'Wisata Religi Sumber Mata Air Nyapar, Dasuk', 'wira', 'Terletak di Dasuk, Kabupaten Sumenep, Madura, Sumber Mata Air Nyapar merupakan salah satu destinasi wisata religi yang memadukan keindahan alam dan arsitektur tradisional. Gambar yang ditampilkan menunjukkan sebuah masjid megah yang berdiri anggun di tepi sumber mata air alami, menawarkan suasana yang damai dan menenangkan.\nMasjid yang berada di kawasan Sumber Mata Air Nyapar ini memiliki desain arsitektur yang khas, dengan atap bertingkat dan dinding berwarna putih yang memberikan kesan megah dan sakral. Gaya arsitektur tradisional ini harmonis dengan lingkungan sekitarnya, menciptakan pemandangan yang indah dan menenangkan.\n\n\n– Sumber Mata Air yang Menyegarkan\nKolam mata air yang terletak tepat di depan masjid menjadi daya tarik utama bagi para pengunjung. Airnya yang jernih dan segar menarik banyak orang untuk datang dan menikmati mandi di sini. Selain memberikan kesegaran, berendam di air alami ini dipercaya memiliki berbagai manfaat kesehatan, seperti relaksasi otot dan penyembuhan alami.\n\n– Suasana yang Tenang dan Asri\nPengunjung yang datang ke Sumber Mata Air Nyapar akan disambut oleh suasana damai dan tenang, jauh dari hiruk-pikuk kehidupan perkotaan. Pepohonan hijau yang rimbun di sekitar area ini menambah kesejukan dan membuat lingkungan semakin nyaman. Tempat ini sangat cocok bagi mereka yang ingin melepas penat dan mencari ketenangan jiwa.\n\n\n\n\n\n', 'Lainnya', );
INSERT INTO `artikel` (`id`, `judul`, `judul_kedua`, `author`, `deskripsi`, `kategori`, `gambar`) VALUES
(7, 'Kisah Potre Koneng', 'Putri Dari Sumenep', 'anur', 'Potre koneng atau dalam bahasa Indonesianya, Putri Kuning adalah cerita dari daerah Sumenep di pulau Madura.\nMerupakan seorang putri yang cantik, dari anak raja Sumenep, wajahnya Elok rupawan serta kulitnya yang kuning langsat, sehingga itulah kenapa dia disebut sebagai Potre Koneng.\n\nBagi warga Madura, Potre Koneng terkenal juga dengan tutur bahasanya yang halus dan lembut.\n\nMenjadi impian banyak pria tersohor, ternyata sosok ayu Potre Sumenep ini memiliki kisah bersama Joko Tole.\n\n', 'Sejarah', );
